import Players from "./Players";
import { Link,useNavigate } from "react-router-dom";

const Delete=()=>{
    let history= useNavigate();
    const handleDelete=(id)=>{
        var index=Players.map((e)=>{
            return e.id;
        }).indexOf(id);
        Players.splice(index,1);
        history("/")
    }

}

export default Delete;
